@testset "7.2.4 (f x)^m (d+e x^2)^p (a+b arccosh(c x))^n" begin
    @variables a, b, c, d, d1, d2, e, f, m, n, x

    #= ::Package:: =#

    #= ::Title:: =#
    #=Integrands*of*the*form*(f*x)^m*(d-c^2*d*x^2)^p*(a+b*acosh(c*x))^n=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(f*x)^m*(d-c^2*d*x^2)^p*(a+b*acosh(c*x))^1=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*x^m*(d-c^2*d*x^2)^p*(a+b*acosh(c*x))=#


    #= ::Subsubsection::Closed:: =#
    #=p>0=#


    @test_int [x^4*(d - c^2*d*x^2)*(a + b*acosh(c*x)), x, 8, -((152*b*d*sqrt(-1 + c*x)*sqrt(1 + c*x))/(3675*c^5)) - (76*b*d*x^2*sqrt(-1 + c*x)*sqrt(1 + c*x))/(3675*c^3) - (19*b*d*x^4*sqrt(-1 + c*x)*sqrt(1 + c*x))/(1225*c) + (1/49)*b*c*d*x^6*sqrt(-1 + c*x)*sqrt(1 + c*x) + (1/5)*d*x^5*(a + b*acosh(c*x)) - (1/7)*c^2*d*x^7*(a + b*acosh(c*x))]
    @test_int [x^3*(d - c^2*d*x^2)*(a + b*acosh(c*x)), x, 7, -((b*d*x*sqrt(-1 + c*x)*sqrt(1 + c*x))/(24*c^3)) - (b*d*x^3*sqrt(-1 + c*x)*sqrt(1 + c*x))/(36*c) + (1/36)*b*c*d*x^5*sqrt(-1 + c*x)*sqrt(1 + c*x) - (b*d*acosh(c*x))/(24*c^4) + (1/4)*d*x^4*(a + b*acosh(c*x)) - (1/6)*c^2*d*x^6*(a + b*acosh(c*x))]
    @test_int [x^2*(d - c^2*d*x^2)*(a + b*acosh(c*x)), x, 6, -((26*b*d*sqrt(-1 + c*x)*sqrt(1 + c*x))/(225*c^3)) - (13*b*d*x^2*sqrt(-1 + c*x)*sqrt(1 + c*x))/(225*c) + (1/25)*b*c*d*x^4*sqrt(-1 + c*x)*sqrt(1 + c*x) + (1/3)*d*x^3*(a + b*acosh(c*x)) - (1/5)*c^2*d*x^5*(a + b*acosh(c*x))]
    @test_int [x^1*(d - c^2*d*x^2)*(a + b*acosh(c*x)), x, 4, -((3*b*d*x*sqrt(-1 + c*x)*sqrt(1 + c*x))/(32*c)) + (b*d*x*(-1 + c*x)^(3/2)*(1 + c*x)^(3/2))/(16*c) + (3*b*d*acosh(c*x))/(32*c^2) - (d*(1 - c^2*x^2)^2*(a + b*acosh(c*x)))/(4*c^2)]
    @test_int [x^0*(d - c^2*d*x^2)*(a + b*acosh(c*x)), x, 4, -((7*b*d*sqrt(-1 + c*x)*sqrt(1 + c*x))/(9*c)) + (1/9)*b*c*d*x^2*sqrt(-1 + c*x)*sqrt(1 + c*x) + d*x*(a + b*acosh(c*x)) - (1/3)*c^2*d*x^3*(a + b*acosh(c*x))]
    @test_int [((d - c^2*d*x^2)*(a + b*acosh(c*x)))/x^1, x, 8, (1/4)*b*c*d*x*sqrt(-1 + c*x)*sqrt(1 + c*x) - (1/4)*b*d*acosh(c*x) + (1/2)*d*(1 - c^2*x^2)*(a + b*acosh(c*x)) + (d*(a + b*acosh(c*x))^2)/(2*b) + d*(a + b*acosh(c*x))*log(1 + ℯ^(-2*acosh(c*x))) - (1/2)*b*d*PolyLog(2, -ℯ^(-2*acosh(c*x)))]
    @test_int [((d - c^2*d*x^2)*(a + b*acosh(c*x)))/x^2, x, 5, b*c*d*sqrt(-1 + c*x)*sqrt(1 + c*x) - (d*(a + b*acosh(c*x)))/x - c^2*d*x*(a + b*acosh(c*x)) + b*c*d*atan(sqrt(-1 + c*x)*sqrt(1 + c*x))]
    @test_int [((d - c^2*d*x^2)*(a + b*acosh(c*x)))/x^3, x, 9, (b*c*d*sqrt(-1 + c*x)*sqrt(1 + c*x))/(2*x) - (1/2)*b*c^2*d*acosh(c*x) - (d*(1 - c^2*x^2)*(a + b*acosh(c*x)))/(2*x^2) - (c^2*d*(a + b*acosh(c*x))^2)/(2*b) - c^2*d*(a + b*acosh(c*x))*log(1 + ℯ^(-2*acosh(c*x))) + (1/2)*b*c^2*d*PolyLog(2, -ℯ^(-2*acosh(c*x)))]
    @test_int [((d - c^2*d*x^2)*(a + b*acosh(c*x)))/x^4, x, 5, (b*c*d*sqrt(-1 + c*x)*sqrt(1 + c*x))/(6*x^2) - (d*(a + b*acosh(c*x)))/(3*x^3) + (c^2*d*(a + b*acosh(c*x)))/x - (5/6)*b*c^3*d*atan(sqrt(-1 + c*x)*sqrt(1 + c*x))]


    @test_int [x^4*(d - c^2*d*x^2)^2*(a + b*acosh(c*x)), x, 7, -((8*b*d^2*sqrt(-1 + c*x)*sqrt(1 + c*x))/(315*c^5)) + (4*b*d^2*(-1 + c*x)^(3/2)*(1 + c*x)^(3/2))/(945*c^5) - (b*d^2*(-1 + c*x)^(5/2)*(1 + c*x)^(5/2))/(525*c^5) - (10*b*d^2*(-1 + c*x)^(7/2)*(1 + c*x)^(7/2))/(441*c^5) - (b*d^2*(-1 + c*x)^(9/2)*(1 + c*x)^(9/2))/(81*c^5) + (1/5)*d^2*x^5*(a + b*acosh(c*x)) - (2/7)*c^2*d^2*x^7*(a + b*acosh(c*x)) + (1/9)*c^4*d^2*x^9*(a + b*acosh(c*x)), (8*b*d^2*(1 - c^2*x^2))/(315*c^5*sqrt(-1 + c*x)*sqrt(1 + c*x)) + (4*b*d^2*(1 - c^2*x^2)^2)/(945*c^5*sqrt(-1 + c*x)*sqrt(1 + c*x)) + (b*d^2*(1 - c^2*x^2)^3)/(525*c^5*sqrt(-1 + c*x)*sqrt(1 + c*x)) - (10*b*d^2*(1 - c^2*x^2)^4)/(441*c^5*sqrt(-1 + c*x)*sqrt(1 + c*x)) + (b*d^2*(1 - c^2*x^2)^5)/(81*c^5*sqrt(-1 + c*x)*sqrt(1 + c*x)) + (1/5)*d^2*x^5*(a + b*acosh(c*x)) - (2/7)*c^2*d^2*x^7*(a + b*acosh(c*x)) + (1/9)*c^4*d^2*x^9*(a + b*acosh(c*x))]
    @test_int [x^3*(d - c^2*d*x^2)^2*(a + b*acosh(c*x)), x, 9, -((73*b*d^2*x*sqrt(-1 + c*x)*sqrt(1 + c*x))/(3072*c^3)) - (73*b*d^2*x^3*sqrt(-1 + c*x)*sqrt(1 + c*x))/(4608*c) + (43*b*c*d^2*x^5*sqrt(-1 + c*x)*sqrt(1 + c*x))/1152 - (1/64)*b*c^3*d^2*x^7*sqrt(-1 + c*x)*sqrt(1 + c*x) - (73*b*d^2*acosh(c*x))/(3072*c^4) + (1/4)*d^2*x^4*(a + b*acosh(c*x)) - (1/3)*c^2*d^2*x^6*(a + b*acosh(c*x)) + (1/8)*c^4*d^2*x^8*(a + b*acosh(c*x)), (73*b*d^2*x*(1 - c^2*x^2))/(3072*c^3*sqrt(-1 + c*x)*sqrt(1 + c*x)) + (73*b*d^2*x^3*(1 - c^2*x^2))/(4608*c*sqrt(-1 + c*x)*sqrt(1 + c*x)) - (43*b*c*d^2*x^5*(1 - c^2*x^2))/(1152*sqrt(-1 + c*x)*sqrt(1 + c*x)) + (b*c^3*d^2*x^7*(1 - c^2*x^2))/(64*sqrt(-1 + c*x)*sqrt(1 + c*x)) + (1/4)*d^2*x^4*(a + b*acosh(c*x)) - (1/3)*c^2*d^2*x^6*(a + b*acosh(c*x)) + (1/8)*c^4*d^2*x^8*(a + b*acosh(c*x)) - (73*b*d^2*sqrt(-1 + c^2*x^2)*atanh((c*x)/sqrt(-1 + c^2*x^2)))/(3072*c^4*sqrt(-1 + c*x)*sqrt(1 + c*x))]
    @test_int [x^2*(d - c^2*d*x^2)^2*(a + b*acosh(c*x)), x, 6, -((8*b*d^2*sqrt(-1 + c*x)*sqrt(1 + c*x))/(105*c^3)) + (4*b*d^2*(-1 + c*x)^(3/2)*(1 + c*x)^(3/2))/(315*c^3) - (b*d^2*(-1 + c*x)^(5/2)*(1 + c*x)^(5/2))/(175*c^3) - (b*d^2*(-1 + c*x)^(7/2)*(1 + c*x)^(7/2))/(49*c^3) + (1/3)*d^2*x^3*(a + b*acosh(c*x)) - (2/5)*c^2*d^2*x^5*(a + b*acosh(c*x)) + (1/7)*c^4*d^2*x^7*(a + b*acosh(c*x)), (8*b*d^2*(1 - c^2*x^2))/(105*c^3*sqrt(-1 + c*x)*sqrt(1 + c*x)) + (4*b*d^2*(1 - c^2*x^2)^2)/(315*c^3*sqrt(-1 + c*x)*sqrt(1 + c*x)) + (b*d^2*(1 - c^2*x^2)^3)/(175*c^3*sqrt(-1 + c*x)*sqrt(1 + c*x)) - (b*d^2*(1 - c^2*x^2)^4)/(49*c^3*sqrt(-1 + c*x)*sqrt(1 + c*x)) + (1/3)*d^2*x^3*(a + b*acosh(c*x)) - (2/5)*c^2*d^2*x^5*(a + b*acosh(c*x)) + (1/7)*c^4*d^2*x^7*(a + b*acosh(c*x))]
    @test_int [x^1*(d - c^2*d*x^2)^2*(a + b*acosh(c*x)), x, 5, -((5*b*d^2*x*sqrt(-1 + c*x)*sqrt(1 + c*x))/(96*c)) + (5*b*d^2*x*(-1 + c*x)^(3/2)*(1 + c*x)^(3/2))/(144*c) - (b*d^2*x*(-1 + c*x)^(5/2)*(1 + c*x)^(5/2))/(36*c) + (5*b*d^2*acosh(c*x))/(96*c^2) - (d^2*(1 - c^2*x^2)^3*(a + b*acosh(c*x)))/(6*c^2)]
    @test_int [x^0*(d - c^2*d*x^2)^2*(a + b*acosh(c*x)), x, 6, -((8*b*d^2*sqrt(-1 + c*x)*sqrt(1 + c*x))/(15*c)) + (4*b*d^2*(-1 + c*x)^(3/2)*(1 + c*x)^(3/2))/(45*c) - (b*d^2*(-1 + c*x)^(5/2)*(1 + c*x)^(5/2))/(25*c) + d^2*x*(a + b*acosh(c*x)) - (2/3)*c^2*d^2*x^3*(a + b*acosh(c*x)) + (1/5)*c^4*d^2*x^5*(a + b*acosh(c*x)), (8*b*d^2*(1 - c^2*x^2))/(15*c*sqrt(-1 + c*x)*sqrt(1 + c*x)) + (4*b*d^2*(1 - c^2*x^2)^2)/(45*c*sqrt(-1 + c*x)*sqrt(1 + c*x)) + (b*d^2*(1 - c^2*x^2)^3)/(25*c*sqrt(-1 + c*x)*sqrt(1 + c*x)) + d^2*x*(a + b*acosh(c*x)) - (2/3)*c^2*d^2*x^3*(a + b*acosh(c*x)) + (1/5)*c^4*d^2*x^5*(a + b*acosh(c*x))]
    @test_int [((d - c^2*d*x^2)^2*(a + b*acosh(c*x)))/x^1, x, 12, (11/32)*b*c*d^2*x*sqrt(-1 + c*x)*sqrt(1 + c*x) - (1/16)*b*c*d^2*x*(-1 + c*x)^(3/2)*(1 + c*x)^(3/2) - (11/32)*b*d^2*acosh(c*x) + (1/2)*d^2*(1 - c^2*x^2)*(a + b*acosh(c*x)) + (1/4)*d^2*(1 - c^2*x^2)^2*(a + b*acosh(c*x)) + (d^2*(a + b*acosh(c*x))^2)/(2*b) + d^2*(a + b*acosh(c*x))*log(1 + ℯ^(-2*acosh(c*x))) - (1/2)*b*d^2*PolyLog(2, -ℯ^(-2*acosh(c*x)))]
    @test_int [((d - c^2*d*x^2)^2*(a + b*acosh(c*x)))/x^2, x, 8, (5/3)*b*c*d^2*sqrt(-1 + c*x)*sqrt(1 + c*x) - (1/9)*b*c*d^2*(-1 + c*x)^(3/2)*(1 + c*x)^(3/2) - (d^2*(a + b*acosh(c*x)))/x - 2*c^2*d^2*x*(a + b*acosh(c*x)) + (1/3)*c^4*d^2*x^3*(a + b*acosh(c*x)) + b*c*d^2*atan(sqrt(-1 + c*x)*sqrt(1 + c*x)), -((5*b*c*d^2*(1 - c^2*x^2))/(3*sqrt(-1 + c*x)*sqrt(1 + c*x))) - (b*c*d^2*(1 - c^2*x^2)^2)/(9*sqrt(-1 + c*x)*sqrt(1 + c*x)) - (d^2*(a + b*acosh(c*x)))/x - 2*c^2*d^2*x*(a + b*acosh(c*x)) + (1/3)*c^4*d^2*x^3*(a + b*acosh(c*x)) + (b*c*d^2*sqrt(-1 + c^2*x^2)*atan(sqrt(-1 + c^2*x^2)))/(sqrt(-1 + c*x)*sqrt(1 + c*x))]
    @test_int [((d - c^2*d*x^2)^2*(a + b*acosh(c*x)))/x^3, x, 13, (1/4)*b*c^3*d^2*x*sqrt(-1 + c*x)*sqrt(1 + c*x) - (b*c*d^2*(-1 + c*x)^(3/2)*(1 + c*x)^(3/2))/(2*x) - (1/4)*b*c^2*d^2*acosh(c*x) - c^2*d^2*(1 - c^2*x^2)*(a + b*acosh(c*x)) - (d^2*(1 - c^2*x^2)^2*(a + b*acosh(c*x)))/(2*x^2) - (c^2*d^2*(a + b*acosh(c*x))^2)/b - 2*c^2*d^2*(a + b*acosh(c*x))*log(1 + ℯ^(-2*acosh(c*x))) + b*c^2*d^2*PolyLog(2, -ℯ^(-2*acosh(c*x)))]
    @test_int [((d - c^2*d*x^2)^2*(a + b*acosh(c*x)))/x^4, x, 8, (-b)*c^3*d^2*sqrt(-1 + c*x)*sqrt(1 + c*x) + (b*c*d^2*sqrt(-1 + c*x)*sqrt(1 + c*x))/(6*x^2) - (d^2*(a + b*acosh(c*x)))/(3*x^3) + (2*c^2*d^2*(a + b*acosh(c*x)))/x + c^4*d^2*x*(a + b*acosh(c*x)) - (11/6)*b*c^3*d^2*atan(sqrt(-1 + c*x)*sqrt(1 + c*x)), (b*c^3*d^2*(1 - c^2*x^2))/(sqrt(-1 + c*x)*sqrt(1 + c*x)) - (b*c*d^2*(1 - c^2*x^2))/(6*x^2*sqrt(-1 + c*x)*sqrt(1 + c*x)) - (d^2*(a + b*acosh(c*x)))/(3*x^3) + (2*c^2*d^2*(a + b*acosh(c*x)))/x + c^4*d^2*x*(a + b*acosh(c*x)) - (11*b*c^3*d^2*sqrt(-1 + c^2*x^2)*atan(sqrt(-1 + c^2*x^2)))/(6*sqrt(-1 + c*x)*sqrt(1 + c*x))]


    @test_int [x^4*(d - c^2*d*x^2)^3*(a + b*acosh(c*x)), x, 6, -((16*b*d^3*sqrt(-1 + c*x)*sqrt(1 + c*x))/(1155*c^5)) + (8*b*d^3*(-1 + c*x)^(3/2)*(1 + c*x)^(3/2))/(3465*c^5) - (2*b*d^3*(-1 + c*x)^(5/2)*(1 + c*x)^(5/2))/(1925*c^5) + (b*d^3*(-1 + c*x)^(7/2)*(1 + c*x)^(7/2))/(1617*c^5) + (4*b*d^3*(-1 + c*x)^(9/2)*(1 + c*x)^(9/2))/(297*c^5) + (b*d^3*(-1 + c*x)^(11/2)*(1 + c*x)^(11/2))/(121*c^5) + (1/5)*d^3*x^5*(a + b*acosh(c*x)) - (3/7)*c^2*d^3*x^7*(a + b*acosh(c*x)) + (1/3)*c^4*d^3*x^9*(a + b*acosh(c*x)) - (1/11)*c^6*d^3*x^11*(a + b*acosh(c*x)), (16*b*d^3*(1 - c^2*x^2))/(1155*c^5*sqrt(-1 + c*x)*sqrt(1 + c*x)) + (8*b*d^3*(1 - c^2*x^2)^2)/(3465*c^5*sqrt(-1 + c*x)*sqrt(1 + c*x)) + (2*b*d^3*(1 - c^2*x^2)^3)/(1925*c^5*sqrt(-1 + c*x)*sqrt(1 + c*x)) + (b*d^3*(1 - c^2*x^2)^4)/(1617*c^5*sqrt(-1 + c*x)*sqrt(1 + c*x)) - (4*b*d^3*(1 - c^2*x^2)^5)/(297*c^5*sqrt(-1 + c*x)*sqrt(1 + c*x)) + (b*d^3*(1 - c^2*x^2)^6)/(121*c^5*sqrt(-1 + c*x)*sqrt(1 + c*x)) + (1/5)*d^3*x^5*(a + b*acosh(c*x)) - (3/7)*c^2*d^3*x^7*(a + b*acosh(c*x)) + (1/3)*c^4*d^3*x^9*(a + b*acosh(c*x)) - (1/11)*c^6*d^3*x^11*(a + b*acosh(c*x))]
    @test_int [x^3*(d - c^2*d*x^2)^3*(a + b*acosh(c*x)), x, 11, -((49*b*d^3*x*sqrt(-1 + c*x)*sqrt(1 + c*x))/(5120*c^3)) + (49*b*d^3*x*(-1 + c*x)^(3/2)*(1 + c*x)^(3/2))/(7680*c^3) - (49*b*d^3*x*(-1 + c*x)^(5/2)*(1 + c*x)^(5/2))/(9600*c^3) + (7*b*d^3*x*(-1 + c*x)^(7/2)*(1 + c*x)^(7/2))/(1600*c^3) + (b*d^3*x*(-1 + c*x)^(9/2)*(1 + c*x)^(9/2))/(100*c^3) + (49*b*d^3*acosh(c*x))/(5120*c^4) - (d^3*(-1 + c*x)^4*(1 + c*x)^4*(a + b*acosh(c*x)))/(8*c^4) - (d^3*(-1 + c*x)^5*(1 + c*x)^5*(a + b*acosh(c*x)))/(10*c^4), (49*b*d^3*x*(1 - c^2*x^2))/(5120*c^3*sqrt(-1 + c*x)*sqrt(1 + c*x)) + (49*b*d^3*x*(1 - c^2*x^2)^2)/(7680*c^3*sqrt(-1 + c*x)*sqrt(1 + c*x)) + (49*b*d^3*x*(1 - c^2*x^2)^3)/(9600*c^3*sqrt(-1 + c*x)*sqrt(1 + c*x)) + (7*b*d^3*x*(1 - c^2*x^2)^4)/(1600*c^3*sqrt(-1 + c*x)*sqrt(1 + c*x)) - (b*d^3*x*(1 - c^2*x^2)^5)/(100*c^3*sqrt(-1 + c*x)*sqrt(1 + c*x)) - (d^3*(1 - c^2*x^2)^4*(a + b*acosh(c*x)))/(8*c^4) + (d^3*(1 - c^2*x^2)^5*(a + b*acosh(c*x)))/(10*c^4) + (49*b*d^3*sqrt(-1 + c^2*x^2)*atanh((c*x)/sqrt(-1 + c^2*x^2)))/(5120*c^4*sqrt(-1 + c*x)*sqrt(1 + c*x))]
